import React from 'react';
import styles from 'AvailableItems.module.css';
const items = [
    {
        id: 'p1',
        name: 'Alika',
        price: 350,
        Quantity: 500,
    },
    {
        id: 'p2',
        name: 'Azec',
        price: 300,
        Quantity: 500,
    },
    {
        id: 'p3',
        name: 'Korajan',
        price: 450,
        Quantity: 500,
    },
    {
        id: 'p4',
        name: 'Profex',
        price: 250,
        Quantity: 500,
    }
];
const AvailableItems = () => {
    const ItemsList = items.map(item => <li>{item.name} </li>)
    return (
        <section>
            <ul>
                {ItemsList}
            </ul>
        </section>


    )
}
export default AvailableItems;
